E_D("replace into `www_92game_net_6188net_ecms_news_data_1` values('2867','11','','1','0','0','0','龚玥菲写真,人体写真','','','\n    <img alt=\\\\\"龚玥菲迷人人体写真\\\\\" src=\\\\\"/uploads/20150424/201504242132474838.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真\\\\\" /><br />\n<span style=\\\\\"color: #ff0000\\\\\"><strong>龚玥菲简介</strong></span><br />\n<p>\n	龚玥菲，模特、演员、歌手，兰州人。代表作大型静态电影《新金瓶梅》，2013年即将出演的3D版同名大银幕电影《新金瓶梅》。2013年4月龚玥菲出席上海国际车展，其抢眼的黄金甲造型吸引众人眼光，场面一度失控。2013年5月31日龚玥菲应邀出席MSN时尚庆典，蓝色透视装惊艳全场，成为盛典上最耀眼的焦点，并且曝光了一组和&ldquo;大黄鸭&rdquo;的亲密照，人气迅速飙升。为代言其电影同名手机游戏《新金瓶梅ol》，龚玥菲拍摄了&ldquo;大战黑人&rdquo;和&ldquo;全裸卖烧饼&rdquo;写真，再次引起网友膜拜！</p>\n\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(2)\\\\\" src=\\\\\"/uploads/20150424/201504242132484839.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(2)\\\\\" />\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(3)\\\\\" src=\\\\\"/uploads/20150424/201504242132484840.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(3)\\\\\" />\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(4)\\\\\" src=\\\\\"/uploads/20150424/201504242132494841.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(4)\\\\\" />\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(5)\\\\\" src=\\\\\"/uploads/20150424/201504242132504842.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(5)\\\\\" />\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(6)\\\\\" src=\\\\\"/uploads/20150424/201504242132514843.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(6)\\\\\" />\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(7)\\\\\" src=\\\\\"/uploads/20150424/201504242132514844.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(7)\\\\\" />\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(8)\\\\\" src=\\\\\"/uploads/20150424/201504242132524845.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(8)\\\\\" />\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(9)\\\\\" src=\\\\\"/uploads/20150424/201504242132544846.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(9)\\\\\" />\n  \n    <img alt=\\\\\"龚玥菲迷人人体写真(10)\\\\\" src=\\\\\"/uploads/20150424/201504242132564847.jpg\\\\\" title=\\\\\"龚玥菲迷人人体写真(10)\\\\\" />\n  ');");
